import Shell from "./Shell";
import {
  Container,
  CardContent,
  useTheme,
  TextField,
  Autocomplete,
} from "@mui/material";

function Business() {
  const theme = useTheme();

  const properties = (theme) => ({
    businessContainer: {
      component: "div",
      id: "name",
    },
    email: {
      id: "email",
      type: "email",
      label: "email",
      required: true,
    },
    businessName: {
      id: "business name",
      type: "text",
      label: "business name",
      required: true,
    },
  });

  const styles = (theme) => ({
    cardContent: {
      display: "flex",
      flexDirection: "column",

      [theme.breakpoints.up("md")]: {
        justifyContent: "center",
      },
    },

    businessName: {
      [theme.breakpoints.down("sm")]: {
        marginBottom: "1rem",
      },
      [theme.breakpoints.up("sm")]: {
        marginRight: "1rem",
      },
    },
    email: {
      width: "100%",
    },
  });

  const industries = {
    family_physicians: {
      name: "Family Physicians Offices",
      id: "621111",
    },
  };

  return (
    <Shell
      heading="Business Information"
      index={2}
      content={
        <CardContent sx={styles(theme).cardContent}>
          <Container
            // sx={styles(theme).businessContainer}
            {...properties.businessContainer}
          >
            <TextField
              {...properties(theme).businessName}
              sx={styles(theme).businessName}
            />
          </Container>
          <Container>
            <Autocomplete
              disablePortal
              id="combo-box-demo"
              options={top100Films}
              sx={{ width: 300 }}
              renderInput={(params) => <TextField {...params} label="Movie" />}
            />
          </Container>
        </CardContent>
      }
      //   subheading="Click the button below to get started"
      // content={<TextField id="time" type="time" inputProps={inputProps} />}
    />
  );
}

export default Business;
